import React, {Component} from 'react';

export default class LatLngForm extends Component {
	render() {
		return(
			<form>
				<input type="text" name="lat" placeholder="Lat:" />
				<input type="text" name="lng" placeholder="Lng:" />
			</form>
		)
	}
}
